<section class="about">
  <div class="center-container">
    <div class="about__title"><h2>О сервисе</h2></div>
    <div class="about__list">
      <div class="about__list-card">
        <div class="about__card-image"><img src="/img2/about/who-we-are.webp"></div>
        <div class="about__card-title">Кто мы?</div>
        <div class="about__card-text">VPNTYPE - сообщество IT-специалистов, глубоко увлеченных и преданных своему делу профессионалов. Мы стремимся восполнить пробел в доступности и надежности Proxy сервер -сервисов обеспечивая прозрачность и стабильность их использования.</div>
      </div>
      <div class="about__list-card">
        <div class="about__card-image"><img src="/img2/about/our-mission.webp"></div>
        <div class="about__card-title">Наша миссия:</div>
        <div class="about__card-text">Создать Proxy сервер -сервис, который будет отличаться поддержкой всех современных протоколов и возможностью подключения в один клик. Мы нацелены на обеспечение безопасности и конфиденциальности данных наших пользователей.</div>
      </div>
      <div class="about__list-card">
        <div class="about__card-image"><img src="/img2/about/telegram-bot.webp"></div>
        <div class="about__card-title">Telegram-бот?</div>
        <div class="about__card-text">Мы опирались на открытые и проверенные временем opensource-решения, которые уже зарекомендовали себя. Благодаря устойчивости мессенджера telegram к блокировкам и высокому уровню безопасности, мы обеспечиваем непрерывную работу и быструю связь с пользователями.</div>
      </div>
    </div>
  </div>
</section>


